import React from 'react';

const Article = (props) => ( 
    <div>
        <head>
             <h1> { props.title } </h1> 
             <h4> { props.date } </h4> 
             <meta name="author" content="Kate Farley"></meta>
            <hr/>
        </head>
        <p> { props.children } </p> 
    </div>
);

export default Article;
